import React, { Component,useState,useDispatch } from 'react';
import './Login.css'
import { Button, Form ,Container, Row, Col} from 'react-bootstrap';
import {LoginRedux,LoginAction} from '../../store/Action/Login'
import { connect } from 'react-redux';

const dispatch = useDispatch();
function Login() {
	
	const [email, setEmai] = useState('smithcheryl@yahoo.com');
	const [password,setPassword]=useState('12345678');
		const Login=(event)=>{
		event.preventDefault();		
		const params={
			email,
			password
		}
		console.log(params)
		// this.props.LoginRedux(params)
		dispatch({
			type: LoginAction,
			payload: {
			  params
			},
		  });
	}
	return(
		<Container fluid >
		<Row className="loginContainer">
		<Col ></Col>
		<Col >
		<div className="loginForm">
		<h4 className="loginHeader"> LOGIN</h4>
		<Form onSubmit={Login} >
			<Form.Group>
				<Form.Label>Email</Form.Label>
				<Form.Control type="text" required disabled placeholder="Email" name="email" value={email} 
				/>

			</Form.Group>

			<Form.Group>
				<Form.Label>Password</Form.Label>
				<Form.Control type="password" required disabled placeholder="Password" name="password" value={password}  />
			</Form.Group>
			
			<Row>
				<Col>
				
				</Col>
				<Col>
					<Button variant="primary" type="submit"className="mb-4">
					Login
					</Button>
				</Col>
				<Col>
				
				</Col>
			</Row>

			

		</Form>
		</div>		
		</Col>
		<Col ></Col>
		</Row>
		
</Container>		


	);
}
export default connect(null, { LoginRedux })(Login);
